package models

import (
	"fmt"
)

type OAuthWebpage struct {}

type AuthResponse struct {
	Title   string
	Message string
}

var responses = initResponseMessages()

func (w OAuthWebpage) GetImplicitWebpage(clientID string, environment string, redirectURI string) string {
	return fmt.Sprintf(ImplicitAuthWebpage, styles, clientID, redirectURI, environment, yetiImage)
}

func (w OAuthWebpage) GetPKCEWebpage(clientID string, environment string, redirectURI string, codeChallenge string) string {
	return fmt.Sprintf(PKCEAuthWebpage, styles, clientID, redirectURI, codeChallenge, environment, yetiImage)
}

func (w OAuthWebpage) GetResponsePage(result string) string {
	if res, ok := responses[result]; ok {
		return fmt.Sprintf(ResponsePage, res.Title, styles, res.Title, yetiImage, res.Message)
	} else {
		return fmt.Sprintf(ResponsePage, result , styles, result, yetiImage, "An error occured. Please try again.")
	}
}

func initResponseMessages() map[string]AuthResponse {
	r := make(map[string]AuthResponse)

	r[""] = AuthResponse{
		"Success!", "You may now return to the CLI.",
	}

	r["unauthorized_client"] = AuthResponse{
		"Unauthorized Client", "The client is not authorized to request an access token using this method.",
	}

	r["invalid_request"] = AuthResponse{
		"Invalid Request", "The request is missing a required parameter, includes an invalid parameter value, includes a parameter more than once, or is otherwise malformed.",
	}

	r["invalid_scope"] = AuthResponse{
		"Invalid Scope", "The requested scope is invalid, unknown, or malformed.",
	}

	r["unsupported_response_type"] = AuthResponse{
		"Unsupported AuthResponse Type", "The authorization server does not support obtaining an access token using this method.",
	}

	r["access_denied"] = AuthResponse{
		 "Access Denied", "The resource owner or authorization server denied the request.",
	}

	r["server_error"] = AuthResponse{
		"500 Internal Server Error", "The authorization server encountered an unexpected condition that prevented it from fulfilling the request.",
	}

	r["temporarily_unavailable"] = AuthResponse{
		"503 Service Unavailable", "The authorization server is currently unable to handle the request due to a temporary overloading or maintenance of the server.",
	}

	r["invalid_pkce_package"] = AuthResponse{
		"Invalid PKCE", "Invalid PKCE.",
	}

	return r
}

const ImplicitAuthWebpage = `
<html>
<meta http-equiv="refresh" content="2"/>
<head>
	<title>Implicit Login</title>
	<script src="https://sdk-cdn.mypurecloud.com/external/go-cli/axios/0.23.0/axios.min.js"></script> 
	%s
	<script>
		function getParameterByName(name) {
			name = name.replace(/[\[]/, "\\[").replace(/[\]]/, "\\]");
			var regex = new RegExp("[\\#&]" + name + "=([^&#]*)"),
				results = regex.exec(location.hash);
			return results === null ? "" : decodeURIComponent(results[1].replace(/\+/g, " "));
		}

		if(window.location.hash) {
			if (location.hash.includes("error")) {
				axios.get("/error/" + getParameterByName('error'))
			} else {
				axios.get("/access_token/" + getParameterByName('access_token') + "/expires_in/" + getParameterByName('expires_in') + "/token_type/" + getParameterByName('token_type'));
			}            
			location.hash = '';
		} else {
			var queryStringData = {
				response_type : "token",
				client_id : "%s",
				redirect_uri : "%s"
			}
			let encodedURL = new URLSearchParams(queryStringData);
			window.location.replace("https://login.%s/oauth/authorize?" + encodedURL.toString());
		}
	</script>

	</head>
	<body>
		<p><span id="title">Loading...</span></p>
		<p>
		%s
		</p>	
	</body>
</html>
`

const PKCEAuthWebpage = `
<html>
<meta http-equiv="refresh" content="2"/>
<head>
	<title>PKCE Login</title>
	<script src="https://sdk-cdn.mypurecloud.com/external/go-cli/axios/0.23.0/axios.min.js"></script> 
	%s
	<script>
		if(window.location.search) {
			let urlParams = new URLSearchParams(window.location.search);
			if (urlParams.get("error")) {
				axios.get("/error/" + urlParams.get('error'));
			} else {
				let code = urlParams.get('code');
				axios.get("/code/" + urlParams.get('code'));
			}
		} else {
			var queryStringData = {
				response_type : "code",
				client_id : "%s",
				redirect_uri : "%s",
				code_challenge : "%s",
				code_challenge_method: "S256"
			}
			let encodedURL = new URLSearchParams(queryStringData);
			window.location.replace("https://login.%s/oauth/authorize?" + encodedURL.toString());
		}
	</script>

	</head>
	<body>
		<p><span id="title">Loading...</span></p>
		<p>
		%s
		</p>	
	</body>
</html>
`

const ResponsePage = `
<html>
	<head>
		<title>%s</title>
		%s
		<script>
			window.location.hash = '';
			window.history.pushState('Response', 'Response', '/');
		</script>
	</head>
	<body>
		<p><span id="title">%s</span></p>
		<p>
		%s
		</p>
		<p id="message">%s</p>
	</body>
</html>
`

